      </Logo>
      <NavList>
        
        <StyledLink href="">NEUHEITEN</StyledLink>
        <StyledLink href="">TOP BEWERTET</StyledLink>
        <StyledLink href="">SCHMUCK</StyledLink>
        <StyledLink href="">SHOPS</StyledLink>
